import React from 'react';
import axios from 'axios';
import Register from './Register';

class App extends React.Component {
  componentDidMount() {
  }

  loadAPI() {
    const res = axios.get('https://api.coingecko.com/api/v3/coins/markets?vs_currency=usd&order=market_cap_desc&per_page=100&page=1&sparkline=false')
      .then(() => {
        console.log(res);
      });
  }

  onFormSubmit(state) {
    console.log(state.firstname);
    console.log(state.lastname);
    console.log(state.username);
    console.log(state.password);
    console.log(state.confpassword);
  }

  render() {
    return (
      <div className="outline">
        <h3>Crypto Sim</h3>
        <Register onClickSubmit={this.onFormSubmit} />
      </div>
    );
  }
}

export default App;
